  false,\n\t\"url\": null,\n\t\"notes\": \"The Federal Green Challenge (FGC) is a
  national effort under EPA's Sustainable Materials Management (SMM) Program, challenging
  EPA and other federal agencies throughout the country to lead by example in reducing
  the federal government's environmental impact. Federal offices or facilities start
  their participation by selecting a minimum two of the six target areas, including
  Waste, Electronics, Purchasing, Energy, Water, and Transportation.  At least one
  of the selected target areas must be waste, electronics, or purchasing. Members
  commit to an improvement goal of at least five percent per year in their selected
  target areas. A current list of Federal Green Challenge participants and annual
  award winners is made available through the FGC website (https://www.epa.gov/fgc).
  Participants commit to work toward achieving sustainability goals at their facilities
  and meet compliance with Executive Order 13963.  The program started in 2012 and
  the first data were made available in 2013. The FGC is part of EPA's larger SMM
  program (https://www.epa.gov/smm).  Sustainable Materials Management (SMM) is a
  systemic approach to using and reusing materials more productively over their entire
  lifecycles. It represents a change in how our society thinks about the use of natural
  resources and environmental protection. By looking at a product's entire lifecycle
  we can find new opportunities to reduce environmental impacts, conserve resources,
  and reduce costs. There are multiple challenge programs available as part of the
  SMM program, including the Food Recovery Challenge, the Electronics Challenge, the
  Federal Green Challenge, and the WasteWise program.  tttntttt\",\n\t\"license_title\":
